package statedb

import (
	"fmt"
	"reflect"
	"testing"

	"github.com/colorfulnotion/jam/common"
	"github.com/colorfulnotion/jam/types"
)

func TestRho(t *testing.T) {
	a := common.Hex2Bytes("")
	decoded, _, err := types.Decode(a, reflect.TypeOf(AvailabilityAssignments{}))
	if err != nil {
		t.Errorf("Error decoding: %v", err)
	}
	if debug {
		fmt.Println(decoded)
	}
}
